import React from "react";

export default function DogCard({name, image, temperament}){
    return (
        <div>
            <h1>{name}</h1>
            <img src={image} alt="img not found" width="250px" height="190px"/>
            {temperament.map((el, index) => (
            <h5 key= {index}>{el}</h5>

            ))}
        </div>
        );
    }
